import React from 'react';
import Town from './Town.js';
import Dashboard from './Dashboard.js'
import { Col } from 'react-bootstrap';

const Townslist = ({ towns=[] }) => 
    <div className="towns-list">
        {towns.map(town =>
                <Row>
                    <Town key={town.id}
                    {...town} />
                </Row>
            )
        }
        <Dashboard />
    </div>

export default Townslist
